import React from "react";
import { Link } from "react-router-dom";
import logo from '../images/logo.png';

const Navbar = () => {
    return ( 
        <div>
           <div class="navbar">
   <div id="navbar-brand">
    {/* <img src="http://icons.iconarchive.com/icons/sirubico/black-metal/128/Web-b-icon.png"> */}
   </div>
  <Link to="/login"><button id="html"><span id="htmltxt">Login</span></button></Link>
  <Link to="/signup"><button id="html"><span id="htmltxt">Signup</span></button></Link>
  
 
  <img src={mongo} alt='python' id="login" />
    
</div>
<br></br>
<div id="container">
  <h1></h1>
</div>
        </div>
     );
}
 
export default Navbar;
